import React from 'react'

const CategoryItems = () => {
  return (
    <div>
      <div className="containerCat">
        <div className="row">
            <div className="col-sm-12 col-md-4 col-lg-4">1</div>
            <div className="col-sm-12 col-md-4 col-lg-4">2</div>
            <div className="col-sm-12 col-md-4 col-lg-4">3</div>
        </div>
      </div>
    </div>
  )
}

export default CategoryItems;
